(86, 1, '2018-11-14 08:30:23', '2018-11-14 08:30:23', 'Facebook announced Thursday it is creating an independent body to make potentially precedent-setting calls on what content should be yanked from the social network.\r\n\r\nThe announcement came as Facebook reported it has ramped up its ability to quickly detect hate speech and other posts violating community rules, with the leading social network under pressure from regulators in various countries and activists to root out abusive and inappropriate content.\r\n\r\nI have come to believe that we shouldnt be making so many decisions about free expression and safety on our own, Facebook chief executive Mark Zuckerberg said in a media briefing.', 'Facebook', '', 'publish', 'open', 'open', '', 'blog-title-comes-hers', '', '', '2018-11-16 03:52:59', '2018-11-16 03:52:59', '', 0, 'http://localhost/myStore/?p=86', 0, 'post', '', 0),
