(185, 1, '2018-11-16 03:35:31', '2018-11-16 03:35:31', 'Facebook announced Thursday it is creating an independent body to make potentially precedent-setting calls on what content should be yanked from the social network.\n\nThe announcement came as Facebook reported it has ramped up its ability to quickly detect hate speech and other posts violating community rules, with the leading social network under pressure from regulators in various countries and activists to root out abusive and inappropriate content.\n\nI have come to believe that we shouldnt be making so many decisions about free expression and safety on our own, Facebook chief executive Mark Zuckerberg said in a media briefing.', 'Facebook to launch independent body for calls on content', '', 'inherit', 'closed', 'closed', '', '86-autosave-v1', '', '', '2018-11-16 03:35:31', '2018-11-16 03:35:31', '', 86, 'http://localhost/myStore/86-autosave-v1/', 0, 'revision', '', 0),
