(206, 1, '2018-11-16 05:19:53', '2018-11-16 05:19:53', 'Micromax has announced to acquire a conversational Artificial Intelligence (AI) and bot development company XOXCO for an undisclosed sum.\r\n\r\nTexas-based XOXCO has been paving the way in conversational AI since 2013 and was responsible for the creation of Howdy, the first commercially available bot for Slack that helps schedule meetings.\r\n\r\nIt also developed Botkit which provides the development tools used by hundreds of thousands of developers on GitHub. Over the years, we have partnered with XOXCO and have been inspired by this work, said Lili Cheng, Corporate Vice President, Conversational AI at Microsoft on Thursday.', 'Microsoft', '', 'publish', 'open', 'open', '', 'microsoft', '', '', '2018-11-16 05:19:53', '2018-11-16 05:19:53', '', 0, 'http://localhost/myStore/?p=206', 0, 'post', '', 0),
